//       button: 'rgba(0,0,0,.54)',
//       hover: 'rgba(0,0,0,.08)',
//       disabled: 'rgba(0,0,0,.12)',
//     },
//   });

  const columns = [
      {
          name: 'No',
          sortable: true,
          cell: row => <div data-tag="allowRowEvents"><div>{row.title}</div>{row.summary}</div>,
      },
      {
          name: 'Title',
          sortable: true,
          cell: row => <div data-tag="allowRowEvents"><div>{row.title}</div>{row.summary}</div>,
      },
  ];

  const MyDatatable = () => (
      <DataTable
          title="Tabel Warga"
          columns={columns}
          theme="solarized"
      />
  );

  class Datatable extends Component{
      render(){
        return(<MyDatatable />);
    }
}

export default Datatable;
